import { React, theme, calendarTheme, moment } from "./index.js";

const DayButton = (day) => {
  const classes = buttonStyles();
  return (
    <ThemeProvider theme={theme}>
      <Button className={classes.dayButton}>{day.format("D")}</Button>
    </ThemeProvider>
  );
};

export default DayButton;
